import { configureStore } from "@reduxjs/toolkit";
import model from "../store/SpecificationSlice";
import memory from "../store/SpecificationSlice";
import price from "./";

const store = configureStore({
    reducer: {
        model: model,
        memory: memory,
        price: price
    }
});

export default store;
